import React from "react";
// import styled from "styled-components";
import PreviousWorkoutCard from "./PreviousWorkoutCard";

// Context
// import {WorkoutContext} from '../contexts/WorkoutContext';


export default function PreviousWorkout (props) {
    const allWorkouts = props.workoutsArray
    console.log("allWorkouts", allWorkouts)
    // const allWorkouts = []
    return(
        <div className="workout-list">
            {(!allWorkouts.length)? (allWorkouts.map(workout => (
                <PreviousWorkoutCard key={workout.id} workout={workout} />
                // <PreviousWorkoutCard key={workout.id} {...workoutsArray} workout={workout} />
            ))): ("loading workout only")}
            <PreviousWorkoutCard></PreviousWorkoutCard>
        </div>
    );
}
